	add("pennant", "{\"term\":\"pennant\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"Old English \u0027penon\u0027 \u0027\u0027 \u0027\u0027 Old french (842-ca. 1400) \u0027penon\u0027 French \u0027pennon\u0027 from Latin {{attention|la}} \u0027\u0027 feather. See \u0027\u0027 a feather, and compare \u0027\u0027 \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A flag normally used by naval vessels to represent a special condition\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The broad pennant flown by commodores\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The church pennant indicating religious services are taking place aboard ship\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The commissioning pennant flown on ceremonial occasions\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The winning of a competition, represented by a flag\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The New York Yankees have won the American League \u0027\u0027pennant\u0027\u0027 far more often than any other team\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A rope or strap to which a purchase is hooked\", \"priority\":7}]}, \"synonyms\":{}}");

	add("pennies", "{\"term\":\"pennies\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An unspecified, but very small amount of money. (\u0027It costs only pennies per day\", \"priority\":1}]}, \"synonyms\":{}}");

	add("pennon", "{\"term\":\"pennon\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"anglo-norman\"], \"text\":\"Anglo-norman \u0027penun\u0027 \u0027penoun\u0027 from Old french (842-ca. 1400) \u0027penne\u0027 (feather) + \u0027-on\u0027 () diminutive suffix.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A thin triangular flag or streamer, especially as hung from the end of a lance or spear\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1909\u0027\u0027, Charles Henry Ashdown, \u0027European Arms \u0026amp; Armor\u0027, page 65\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Nearly all the Norman spears were embellished with \u0027\u0027pennons\u0027\u0027 of from two to five points\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A pennant; a long pointed streamer or flag on a vessel\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A wing; a pinion\", \"priority\":5}]}, \"synonyms\":{}}");

	add("pennsylvanian", "{\"term\":\"pennsylvanian\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|Pennsylvania|an|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An inhabitant or a resident of the state of Pennsylvania\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Any of the three Pennsylvanian epochs\", \"priority\":2}]}, \"synonyms\":{}}");

	add("pennycress", "{\"term\":\"pennycress\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|penny|cress|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of several plants, of the genus \u0027Thlaspi\u0027, that have flattened seedpods (in the form of an old penny\", \"priority\":1}]}, \"synonyms\":{}}");

	add("pennyroyal", "{\"term\":\"pennyroyal\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\", \"anglo-norman\"], \"text\":\"Apparently an alteration (after \u0027\u0027 of Anglo-norman \u0027puliol royal\u0027 from Latin \u0027pulegium\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a plant of the mint family, formerly much used in various medicinal treatments and as a flea repellant\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1653\u0027\u0027, \u0027The English Physician Enlarged\u0027, Folio Society 2007, p. 216\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Dioscorides says that \u0027\u0027Pennyroyal\u0027\u0027 makes thin, tough phlegm, warms the coldness of any part whereto it is applied, and digests raw or corrupt matter\", \"priority\":3}]}, \"synonyms\":{}}");

	add("penobsquisite", "{\"term\":\"penobsquisite\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|Penobscot|ite|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A monoclinic-sphenoidal pale yellow mineral containing boron, calcium, chlorine, hydrogen, iron, and oxygen\", \"priority\":1}]}, \"synonyms\":{}}");

	add("pensioner", "{\"term\":\"pensioner\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"anglo-norman\"], \"text\":\"From Anglo-norman \u0027pensionner\u0027 from Old french (842-ca. 1400) \u0027pensionnier\u0027 from \u0027pensionarius\u0027 Surface etymology is {{suffix|pension|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Someone who lives on a pension\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Someone who is at the age at which one typically receives a pension; an elderly person\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A student who is not dependent on any foundation for support, but pays all university charges; at Oxford called a commoner\", \"priority\":3}]}, \"synonyms\":{}}");

	add("pensiveness", "{\"term\":\"pensiveness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|pensive|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A thoughtful or reflective state, especially if sad or melancholic\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"We left quietly so as not to disturb the widow\u0027s \u0027\u0027pensiveness\", \"priority\":2}]}, \"synonyms\":{}}");

